import React from 'react'
import Items from './logs-items'
import './logs.css'

export default function Logs() {
  const logsData = [
    {
     date:new Date(2022,11,5,13,10),
     desc:"哈利波特",
     time:300
    },
    {
     date:new Date(2023,1,5,23,15),
     desc:"漫步華爾街",
     time:200
    },
    {
     date:new Date(2023,2,15,20,30),
     desc:"人間失格",
     time:120
    },
    {
     date:new Date(2023,6,20,23,5),
     desc:"烙印勇士",
     time:300
    }
  ]

  const dataBase = logsData.map(items => <Items keydate={items.date}  desc={items.desc} time={items.time}/>)
  return (
    <div className='logs'>
      {dataBase}

    </div>
    
  )
}
